import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import CatApp from './CatApp/CatApp';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/CatApp" element={<CatApp />} />
      </Routes>
    </Router>
  );
}

export default App;
